import React from 'react';
import Contact from './Contact';

const ContactList = ({ contacts }) => {
    return (
        <table>
            <thead>
                <tr>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Phone</th>
                    <th>Actions</th>
                </tr>
            </thead>
            <tbody>
                {contacts.map(contact => (
                    <Contact key={contact.id} contact={contact} />
                ))}
            </tbody>
        </table>
    );
};

export default ContactList;
